var sync_token=configuration['calendarEvents.syncToken'];

var id_token;

if(sync_token.indexOf(calendarId) > -1){
//Split with comma and also remove spaces if exists
id_token=sync_token.substring(sync_token.indexOf(calendarId)).split(/\s*,\s*/)[0];

}
var response=response_body;

//If sync_token is exist in response body then get and store it in configuration.
if(response.nextSyncToken!==undefined){
var new_id_token=calendarId+"="+response.nextSyncToken;

if(sync_token.indexOf(calendarId) > -1){
 sync_token=sync_token.replace(id_token,new_id_token);

}else{
 sync_token=sync_token+","+new_id_token;

}
configuration['calendarEvents.syncToken']=sync_token;

done({
'configuration': configuration
});

}else{
console.log("no sync-token in response body");

done({});

}

var request_vendor_path=request_vendor_path;

var calendarId=request_vendor_path.split("/")[2];

var sync_token=configuration['calendarEvents.syncToken'];

var request_vendor_path=request_vendor_path+'?showDeleted=true';

/*If calendarId and sync_token exists then add sync_token  in request vendor path so that we will
 get only changed data from the vendor side.
*/
if(sync_token.indexOf(calendarId) > -1){
var id_token=sync_token.substring(sync_token.indexOf(calendarId)).split(/\s*,\s*/)[0];

var token=id_token.substring(id_token.indexOf("=")+1);

if(token!==undefined || token!=="undefined"){
request_vendor_path=request_vendor_path+'&syncToken='+token;

}
}
done({
request_vendor_path:request_vendor_path,
continue: true
});

if (configuration['event.notification.enabled'] == "true") {
var http = require("https");

var urls=request_vendor_url.split("/");

let path = "/"+urls[3]+"/"+urls[4] + request_vendor_path;

//Function to convert string to Javascript object.
var getJsonObject = function(str) {
try {
return JSON.parse(str);

} catch (e) {
return str;

}
};

//Get a poller configuration
var poller_conf = getJsonObject(configuration['event.poller.configuration']);

var sync_token = [];

var poller_conf_keys = Object.keys(poller_conf);

/*Function which processes on each calendar which has been given in event
poller configuration. It  will get sync_token for calendar and store in  sync_token array.
After getting sync_token for each calendar it will convert sync_token to string and assign
to 'calendarEvents.syncToken' configuration variable.
*/
var processPollerItems = function(x) {
if (x < poller_conf_keys.length) {
var value = poller_conf[poller_conf_keys[x]];

var calendarId = value['url'].split("/")[4];

path = path.replace(path.split("/")[4], calendarId);

let requestParams = '?maxResults=2500';

var options = {
"hostname": "www.googleapis.com",
"method": request_vendor_method,
"port": 443,
"path": path + requestParams,
"headers": request_vendor_headers
};

/*
Anonymous function which will recursively execute until we get the sync-token
from the vendor side for calendar.
*/
(function loop() {
  var req = http.request(options, function(res) {
  var body = '';


  res.on("data", function(d) {
  body += d;

  });


  res.on("end", function() {
  try {
  var parsed = JSON.parse(body);

	//If response contained page-token then add it in query param and again execute same API.
  if (parsed.nextPageToken) {
  options['path'] = path + requestParams + '&pageToken=' + parsed.nextPageToken;

  loop();

  } else {
	/*If there is no page-token in response it means sync_token has been provided in response.
	Get it and save in configuration.Then call processPollerItems function for next calendarId.
	*/
  sync_token.push(calendarId + '=' + parsed.nextSyncToken);

  configuration['calendarEvents.syncToken'] = sync_token.toString();

  processPollerItems(x + 1);

	//If its last poller item..We are done. Return the lastest configuration
  if (x == poller_conf_keys.length - 1) {
  done({
  'configuration': configuration
  });}
  }}catch (e) {
  console.log(e.message);

  done({
    "response_error": e.message
 });}
 });


 req.on('error', (e) => {
  console.log(e.message);

 done({
   "response_error": e.message
 });

 });

 });

 req.end();

 }());

}
};

processPollerItems(0);

}else{
	console.log("Event has been not enabled");

	done({
	});

}

var formattedEvents = [];
 var resource=events.objectType;
 var eventBody=events[resource];
 for(var arrayItem=0; arrayItem < eventBody.length; arrayItem++){
var eventObj = {};
 eventObj.event_type=eventBody[arrayItem].eventType;
 if(eventBody[arrayItem].status=='cancelled'){
 eventObj.event_type='DELETED';
 }
 eventObj.event_object_type=resource.replace("changed-events","events");
 eventObj.event_object_id=eventBody[arrayItem].id;
 eventObj.event_date=eventBody[arrayItem].updated;
 formattedEvents.push(eventObj);
}
done({
 "events": formattedEvents
});
